C Programming Data Type: Printing Integer Now we are going to modifiy the script again $ vim inputoutput.c to look like below: #include <stdio.h>
int main()
{ int testInteger = 5; printf("Number = %d", testInteger); return 0;
} Remeber to use the vim shortcuts from before to edit, write and quit. Run the script again... $ ./inputoutput.anything What happened? Well we need to recompile the code. $ gcc inputoutput.c -o inputoutput.anything
$ ./inputoutput.anything
Number = 5 We use %d format specifier to print int types. Here, the %d inside the quotations will be replaced by the value of testInteger. Data Types: Printing Float and Double Open and modify the same file again to look like below: #include <stdio.h>
int main()
{ float number1 = 13.5; double number2 = 12.4; printf("number1 = %f\n", number1); printf("number2 = %lf", number2); return 0;
} Compile the code again using format gcc <filesource> -o <fileoutput>... hint what did you do before? Run it ./<fileoutput>: $ ./inputoutput.anything number1 = 13.500000
number2 = 12.400000 To print float, we use %f format specifier. Similarly, we use %lf to print double values. Data Types: Printing Characters Open and modify the same file again to look like below: #include <stdio.h>
int main()
{ char chr = 'a'; printf("character = %c", chr); return 0;
} Remember to compile and then run: $ ./inputoutput.anything character = a To print char, we use %c format specifier. User Input in C In C programming, scanf() is one of the commonly used function to take input from the user. The scanf() function reads formatted input from the standard input such as keyboards. Again we will modify the program to look like the code below: #include <stdio.h>
int main()
{ int testInteger; printf("Enter an integer: "); scanf("%d", &testInteger); printf("Number = %d",testInteger); return 0;
} Compile and run: $ ./inputoutput.anything
Enter an integer: 4
Number = 4 Here, we have used %d format specifier inside the scanf() function to take int input from the user. When the user enters an integer, it is stored in the testInteger variable. Notice, that we have used &testInteger inside scanf(). It is because &testInteger gets the address of testInteger, and the value entered by the user is stored in that address. We will cover addressing and pointers at a later date.

